        FORTNITE_GIFT_INVENTORY_INFO:
          "Sovita varusteet uuteen asuusi {guardOutfitName}!\n\n{rewardName} on avattavissa Discord-droppina 4.5. alkaen. Voit avata sen kummalla tahansa seuraavista tavoista:\n\nStriimaa Fortnitea liven\xe4 Discordissa ruudunjakoa k\xe4ytt\xe4m\xe4ll\xe4 v\xe4hint\xe4\xe4n 15 minuutin ajan v\xe4hint\xe4\xe4n yhdelle Discord-kaverille.\n\nKun olet k\xe4ytt\xe4nyt ruudunjakoa kaverille 15 minuutin ajan, saat lahjalinkin, jonka saat k\xe4ytt\xf6\xf6si valitsemalla Asetukset > Lahjaluettelo.\n\nKlikkaa linkki\xe4 ja kirjaudu Epic Games ‑tilillesi, niin wrap lis\xe4t\xe4\xe4n Fortnite Lockeriisi!\n\nEtk\xf6 pysty striimaamaan? Voit vaihtoehtoisesti ottaa vastaan Discord-bottiteht\xe4v\xe4n! Aloita liittym\xe4ll\xe4 [Fortniten viralliselle Discord-palvelimelle](http://discord.gg/fortnite).\n\nPalvelimella n\xe4et botin, jonka kanssa toimimalla voit liitty\xe4 Discord-teht\xe4v\xe4\xe4n.\n\nKun k\xe4yt\xe4t bottia, p\xe4\xe4set sivulle, jossa voit linkitt\xe4\xe4 Epic- ja Discord-tilisi.\n\nKun olet linkitt\xe4nyt tilisi, osallistu teht\xe4v\xe4\xe4n suorittamalla teht\xe4v\xe4 Discordissa ja Fortnitessa.\n\nKun olet suorittanut n\xe4m\xe4 teht\xe4v\xe4t, wrap lis\xe4t\xe4\xe4n Fortnite Lockeriisi!\n\nLue lis\xe4\xe4 t\xe4st\xe4 blogijulkaisustamme!\n",
